import React, { Component } from 'react'

class Filter extends Component {
  render() {
    return (
      <div className='filter_parent'>
        <div>
            <label for="text_filter">Text:</label>
            <input type="text" id="text_filter" name="text_filter"></input>

            <label for="likes">Like count:</label>
            <input type="number" id="likes" name="likes" min="0" max="100"></input>
        </div>

        <div>
            <button onClick>Apply Filters</button>
        </div>
      </div>
    )
  }
}

export default Filter
